import React, { Component } from 'react';
import './App.css';

class App extends Component {

  constructor(props) {
    super(props)

    this.state = {
      user: {
        email: "",
        firstName: "",
        lastName: "",
        authed: true
      }
    }
  }

  render() {
    return (
      <div className="App">
        {this.state.authed ? <div>Welcome!</div> : <div>You're not welcome</div>}
      </div>
    );
  }
}

export default App;
